function Hero(props){
    return(
        <>
            <div className={props.cName}>
                <img alt="HeroImg" src=""/>
                <div className="hero-text">
                    <h1>Good Quality Food Expoter from India</h1>
                </div>
            </div>
        </>
    );
}

export default Hero;
